(15, 1, '2023-10-04 08:04:55', '2023-10-04 08:04:55', '<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><!-- wp:paragraph -->\n<p><strong>Test Task Objective:</strong> Develop a WooCommerce Product Import System from a File Containing Product Data.</p>\n<!-- /wp:paragraph --></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://s3-us-west-2.amazonaws.com/secure.notion-static.com/8fe065e3-e442-4ae6-ae70-c15a520017e4/products.xml\" target=\"_blank\" rel=\"noreferrer noopener\">products.xml</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"/wp-content/uploads/import/products.xml\" target=\"_blank\" rel=\"noreferrer noopener\">local-products.xml</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Instructions:</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><!-- wp:list-item -->\n<li>Install a clean WordPress along with WooCommerce on your local computer or hosting.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Create a script to import products from a file once a day.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Push the code to your Git repository:<br>Upload your working code to a Git repository that you\'ll create for this task.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Place the database dump in the root of the repository:<br>Create a database dump from your WordPress + WooCommerce project.<br>Add the database dump file to the root of your Git repository.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Result:<br>Send us the link to your Git repository with all completed tasks.</li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->\n\n<!-- wp:group {\"backgroundColor\":\"pale-cyan-blue\",\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group has-pale-cyan-blue-background-color has-background\"><!-- wp:paragraph -->\n<p>💡 <strong>Additional Notes:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>You can choose the programming language and tools that best suit your preferences for completing the task.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>We will evaluate your solutions based on code quality, adherence to standards, clarity, and the extensibility of the program.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Make sure your Git repository includes the source code of the project, the import script, the database dump, and any other relevant files. </li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list --></div>\n<!-- /wp:group -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><!-- wp:paragraph -->\n<p>If you have any questions regarding the task, feel free to reach out to us for additional information. Best of luck with completing the test assignment!</p>\n<!-- /wp:paragraph --></blockquote>\n<!-- /wp:quote -->', 'Test task for WordPress Developer', '', 'publish', 'closed', 'closed', '', 'test-task-for-wordpress-developer', '', '', '2023-10-04 08:17:42', '2023-10-04 08:17:42', '', 0, 'http://localhost/?page_id=15', 0, 'page', '', 0),
(16, 1, '2023-10-04 08:04:55', '2023-10-04 08:04:55', '<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><!-- wp:paragraph -->\n<p><strong>Test Task Objective:</strong> Develop a WooCommerce Product Import System from a File Containing Product Data.</p>\n<!-- /wp:paragraph --></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://s3-us-west-2.amazonaws.com/secure.notion-static.com/8fe065e3-e442-4ae6-ae70-c15a520017e4/products.xml\">products.xml</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"/wp-content/uploads/import/products.xml\">local-products.xml</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 class=\"wp-block-heading\"><strong>Instructions:</strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><!-- wp:list-item -->\n<li>Install a clean WordPress along with WooCommerce on your local computer or hosting.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Create a script to import products from a file once a day.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Push the code to your Git repository:</li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Upload your working code to a Git repository that you\'ll create for this task.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><!-- wp:list-item -->\n<li>Place the database dump in the root of the repository:</li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Create a database dump from your WordPress + WooCommerce project.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Add the database dump file to the root of your Git repository.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><!-- wp:list-item -->\n<li>Result:</li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Send us the link to your Git repository with all completed tasks.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>&lt;aside&gt; 💡 <strong>Additional Notes:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>You can choose the programming language and tools that best suit your preferences for completing the task.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>We will evaluate your solutions based on code quality, adherence to standards, clarity, and the extensibility of the program.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Make sure your Git repository includes the source code of the project, the import script, the database dump, and any other relevant files. &lt;/aside&gt;</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><!-- wp:paragraph -->\n<p>If you have any questions regarding the task, feel free to reach out to us for additional information. Best of luck with completing the test assignment!</p>\n<!-- /wp:paragraph --></blockquote>\n<!-- /wp:quote -->', 'Test task for WordPress Developer', '', 'inherit', 'closed', 'closed', '', '15-revision-v1', '', '', '2023-10-04 08:04:55', '2023-10-04 08:04:55', '', 15, 'http://localhost/?p=16', 0, 'revision', '', 0),
